mapper.select:

select 

from T_PRP_LCPOLTRANSACTION_RETURN
where TRANSACTIONID = #{transactionid,jdbcType=VARCHAR}
  and BATCHNO = #{batchno,jdbcType=VARCHAR}
  and BUSSTYPE = #{busstype,jdbcType=VARCHAR}

mapper.delete:

delete from T_PRP_LCPOLTRANSACTION_RETURN
where TRANSACTIONID = #{transactionid,jdbcType=VARCHAR}
  and BATCHNO = #{batchno,jdbcType=VARCHAR}
  and BUSSTYPE = #{busstype,jdbcType=VARCHAR}
